#nav {
  position:fixed;
  bottom:0;
  left:0; 
  right:0;
  z-index: 1;
  height: 44px;
  line-height: 44px;
  display: flex;
  background: #fff;
  border-top:1px solid #ccc;
  .nav-item {
    flex:1;
    text-align: center;
    text-decoration: none;
    font-weight: bold;
    color: #2c3e50;
    &.on{
      .icon_active{ display: block;}
      .icon_private{ display: none;}
      .nav-txt{
        color:#000;
      }
    }
    .nav-img{
      display: block;
      margin:0 auto;
      width: 25px;
      height:25px;
    }
    .icon_active{
      display: none;
    }
    .nav-txt{
      height: 20px;
      line-height: 20px;
      color:#333;
    }
    // &.router-link-exact-active {
    //   color: #42b983;
    // }
  }
}
